import {BrowserRouter, Route} from "react-router-dom";

class App extends Component {
render(){
  return (
    <BrowserRouter>
    <div className="container">
      <Route path="/" exact component = {LandingPage}/>
      </div></BrowserRouter>
  )
}
}

export default App;
